INSERT INTO `alert` (`ID`, `Name`, `Active`, `Subject`, `Body`, `FromEmail`, `FromAlias`, `ToAuxEmails`, `ToSelf`, `Settings`, `Type`, `AlertDate`, `Module`, `Dashboard`, `CreateDate`) VALUES
(1, 'Alerta pontaj', 0, '', 'Salut <<FullName>>,\r\n\r\nIeri <<yesterday>> ati pontat <<THours>> ore. Puteti modifica pontajul aferent zilei de ieri pana azi la ora 15:00 cel mai tarziu.\r\n\r\nMultumesc,\r\nHR Executive', '', 'HR Executive - Alerte', '', 1, 'a:2:{s:5:"hours";s:1:"8";s:5:"roles";a:5:{i:15;s:1:"1";i:26;s:1:"1";i:27;s:1:"1";i:16;s:1:"1";i:22;s:1:"1";}}', 'daily', '2012-02-03 08:00:00', 11, 1, '2009-07-27 08:39:46'),
(2, 'Alerta certificate / atestate', 1, 'Alerta certificate / atestate', 'Buna ziua <<FullName>>,\r\n\r\nCertificatul <<CertifName>> <<CertifText>> pe <<StopDate>>!\r\n\r\nMultumesc,\r\nHR Executive', '', 'HR Executive - Alerte', '', 1, 'a:3:{s:4:"days";s:1:"0";s:7:"int_rec";s:0:"";s:5:"roles";a:8:{i:15;s:1:"1";i:16;s:1:"1";i:20;s:1:"1";i:22;s:1:"1";i:28;s:1:"1";i:26;s:1:"1";i:27;s:1:"1";i:29;s:1:"1";}}', 'daily', '2018-04-18 08:00:00', 1, 1, '0000-00-00 00:00:00'),
